import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <Container>
      <Row>
        <Col lg={12}>
          <p>&copy; Copyright, 2022, urluckyturtle</p>
          <img src="images/logo.svg" />
        </Col>
      </Row>
    </Container>
  );
};

export default Footer;
